import React from "react";

class Children extends React.Component {
  render() {
    //console.log(this.props.sum(5)) // 7
    return (
      <div>
        <h1>Aca: {this.props.title}</h1>
        <p>alla: {this.props.content}</p>

      </div>
    );
  }
}

export default Children;
